script: |
  super -f text -I q7231.spq | sort > q7231.out

inputs:
  - name: q7231.spq
    data: |
      SELECT DISTINCT col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - 42 + - + 70 - - col2 * col1 * col2 * + 79 * - - col0 IN ( + col1, - col1 + - col2, - + col2 );
  - name: tab2

outputs:
  - name: q7231.out
    data: |
      23
      40
      58
